import classes from './Footer.module.sass'
import {Wrapper} from "../layout/Wrapper";

const Footer = () => {

    return (
    <div className={classes.footer}>
        <Wrapper>
            <div className={classes.content}>
                <div className={classes.mail}>
                    <h2></h2>
                </div>
            </div>
        </Wrapper>
    </div>
    )

}

export default Footer
